const supabase = createClient(supabaseUrl, supabaseKey);

export default function ActButton(props) {
    let color = "white";
    if (props.completed === true) {
        let color = "#424242"
    }

    return (
        <>
            <button style={{
                backgroundColor: "#1f1f1f",
                color: "white",
                padding: "10px",
                borderRadius: "10px",
                margin: "10px",
                border: "3px solid #424242",
                cursor: "pointer",
                fontSize: "4vw",

            }}>
                {props.name}
            </button>
        </>
    );
}
